import React from 'react'
import classes from './Users.module.css'
// import UsersContainer from './UsersContainer'

function Users(props) {
    if (props.users.length === 0){
        console.log(props)
        props.setUsers([
            {
                id: 1, followed: true,
                avatar: 'https://imagesvc.meredithcorp.io/v3/mm/image?url=https%3A%2F%2Fimagesvc.meredithcorp.io%2Fv3%2Fmm%2Fimage%3Furl%3Dhttps%253A%252F%252Fstatic.onecms.io%252Fwp-content%252Fuploads%252Fsites%252F13%252F2015%252F03%252F04%252FSquidward_Design_2.jpg&q=85',
                fullname: 'Squid Ward', status: 'Hello world', location: { country: 'Ocean', city: 'Bikini' }
            },
            {
                id: 2, followed: false,
                avatar: 'https://all-t-shirts.ru/goods_images/ru110593II000eed5c5dc8999b359b5e0e6cd786bae4b.jpg',
                fullname: 'Pat Rick', status: 'World Hello', location: { country: 'Ocean', city: 'Bikini' }
            },
            {
                id: 3, followed: false,
                avatar: 'https://all-t-shirts.ru/goods_images/ru110593II000eed5c5dc8999b359b5e0e6cd786bae4b.jpg',
                fullname: 'Pat Rick', status: 'World Hello', location: { country: 'Ocean', city: 'Bikini' }
            }
        ]
        )
    }


    return <div>Users{
        props.users.map(u => (
            <div key={u.id} className={classes.users}>
                <div className={classes.user}><img src={u.avatar} /><br />
                    <div>
                        {u.followed
                            ? <button onClick={() => { props.unfollow(u.id) }}>unfollow</button>
                            : <button onClick={() => { props.follow(u.id) }}>follow</button>}
                    </div>
                </div>

                <div className={classes.info}>
                    <div className={classes.name}>
                        <div>{u.fullname}</div>
                        <div>{u.status}</div>
                    </div>
                    <div className={classes.location}>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </div>
                </div>
            </div>))
    }
    </div>
}

export default Users
